package com.iyam.mycash.modelimport android.os.Parcelableimport androidx.annotation.Keepimport kotlinx.parcelize.Parcelizeimport kotlinx.serialization.Serializable@Parcelize@Keep@Serializabledata class Outlet(    val id: String?,    val name: String?,    val type: String?,    val phoneNumber: String?,    val address: String?,    val district: String?,    val city: String?,    val province: String?,    val image: String?,    val userId: String?,    val createdAt: String?,    val updatedAt: String?) : Parcelable